import React from "react";


export default function Form(event) {

    const [formData, setFormData] = React.useState(
        {
        firstName: "",
        password: "",
        confirmP: "",
        checkbox: true
    })
    console.log(formData)
    function handleChange(event) {
        
        const [name, type, value, checkbox] = event.target
        setFormData(prevState => {
            return {
                ...prevState,
         [name]: type === checkbox ? false : value}}
         )
    }

    function formSubmit() {
        event.preventDefault()

        
    
    }

    return (
        <div>
            <form onSubmit={formSubmit}>
                <input 
                type="text"
                placeholder="First Name"
                onChange={handleChange}
                name = "firstName"
                id="first"
                /> <br />            
                 <input 
                type="password"
                placeholder=" Password"
                onChange={handleChange}
                name = "password"
                id="pass"
                value={formData.password}
                /> <br /> 
                 <input 
                type="password"
                placeholder="Confirm Password"
                onChange={handleChange}
                name = "confirmP"
                id="repass"
                value={formData.confirmP}
                /> <br /> 
                <input 
                id="checked" 
                type="checkbox" 
                name="checkbox"
                />

                <label htmlFor="checked" >i want to join the news letter</label> <br /> <br />
                <button>sign up</button>
            </form>
            <div>
                </div>
                </div>
    )
}
